import GmailLogo from '../assets/imgs/gmail-logo.png';
import StackOverflowLogo from '../assets/imgs/stack-overflow-logo.png';
import GitHubLogo from '../assets/imgs/github-logo.png';
import LinkedInLogo from '../assets/imgs/linkedin-logo.png';
import InstagramLogo from '../assets/imgs/instagram-logo.png';
import DiscordLogo from '../assets/imgs/discord-logo.svg';

const socialMedias = [
    {icon: DiscordLogo, mediaName: "Discord"},
    {icon: InstagramLogo, mediaName: "Instagram"},
    {icon: LinkedInLogo, mediaName: "LinkedIn"},
    {icon: GitHubLogo, mediaName: "GitHub"},
    {icon: StackOverflowLogo, mediaName: "Stack Overflow"},
    {icon: GmailLogo, mediaName: "E-mail"}
];

export default socialMedias;
